import React from "react";
import classes from './Modal.module.css'

<CSSTransition
  classNames="example"
  timeout={500}
  in={this.state.mounted}
/>

const Modal = ({active, setActive, num }) => {


    return (
        <div style={{transition: 'all 500ms ease'}} className={active ? classes.modal_active : classes.modal} onClick={() => setActive(false)}>
            <div className={classes.modal_content} onClick={e => e.stopPropagation()}></div>
        </div>
    )
}

export default Modal;
